import React from 'react';
import NavBar from '../../NavBar/navbar';
import '../Home/Home.css';

function Home() {
    return (
        <div>
            <NavBar />
            <div class="container">
                <h2>Photo Card</h2>

                <div class="card">
                    <img src="img_snowtops.jpg" alt="img" style="width:100%" />
                    <div class="w3-container w3-center">
                        <p>The Italian / Austrian Alps</p>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
